  false,\n\t\"url\": null,\n\t\"notes\": \"Please note this is a Pilot Delivery. Geographic
  Extent: Eastern Vermont Area of Interest, covering approximately 2,533 square miles.
  Dataset Description: The Eastern, VT LiDAR project called for the Planning, Acquisition,
  processing and derivative products of LIDAR data to be collected at a nominal pulse
  spacing (NPS) of 0.7 meter. Project specifications are based on the U.S. Geological
  Survey National Geospatial Program Base LIDAR Specification, Version 1. The data
  was developed based on a horizontal projection/datum of Vermont State Plane coordinate
  System (FIPS 4400), NAD83, meters and vertical datum of NAVD1988 (GEOID12A), meters.
  LiDAR data was delivered in RAW flight line swath format, processed to create Classified
  LAS 1.2 Files formatted to 272 individual 1400m x 1400m pilot tiles, and corresponding
  0.7 meter gridded Hydro Flattened Raster DEM Files tiled to the same 1400m x 1400m
  schema,tiled Intensity Images, Hydro-Flattening and Hydro-Enforcement Breaklines
  in ESRI Shapefile format, and 0.7 meter gridded Hydro-Flattening and Hydro-Enforcement
  Raster DEM Files. Ground Conditions: LiDAR collection began in Fall 2014, while
  no snow was on the ground and rivers were at or below normal levels. In order to
  post process the LiDAR data to meet task order specifications, Photo Science established
  a total of 71 ground control points and 85 QC points that were used to calibrate
  the LIDAR to known ground locations established throughout the Eastern, Vermont
  project area. Lot # 6 has 8 control points.\",\n\t\"license_title\": null,\n\t\"extras\":
